import React from 'react';
import * as S from "./MainPage.styled"


function MainPage() {

  return ( 
    <div>
      <S.NavTop><h3>Select Idiom/Genre</h3></S.NavTop>
      <S.Background><h1>The Hills of Kintail</h1></S.Background>
      </div>
  )

}

export default MainPage;
